INSERT INTO `pages` (`id`, `title`, `descripthon`, `image`, `seo_key_word`, `seo_descript`, `is_special`, `created_at`, `updated_at`) VALUES
(1, 'صفحه ی اصلی', '<p>test</p>', 'https://back.avaex.ir/postupPics/interPost/interPostImage.png', 'null', 'بیریبdcsdc', 0, NULL, '2022-12-06 04:08:41'),
(2, 'پست داخلی', '<p>ارتباط یکی از مهم ترین ابزار انسان از ابتدای پیدایش تا کنون بوده است. بدون ارتباط ما انسان ها عملاً قادر به زندگی نخواهیم بود و از بین خواهیم رفت.</p><p>ارتباط به معنای انتقال معنا بین موجودات زنده است. تمام روابط بین موجودات زنده از ارتباط آغاز می شود. برای انسان اولین ابزار ارتباطی که پدید آمد زبان بوده است. هرچه زندگی انسان ها بیشتر پیشرفت کرد، نیاز به ارتباط برای آنها پر رنگ تر شد. بخاطر همین با شکل گیری تمدن بشر، نیاز به نامه نگاری بین انسان ها رواج بیشتری یافت</p><p>به همین جهت سیستم های پیام رسانی از دوران کهن تا به امروز در بین تمدن های انسانی رواج یافته است.</p><p>ایرانیان برای نخستین بار در جهان در زمان هخامنشیان اقدام به تاسیس واحد رسمی پست با عنوان «چاپارخانه» کردند که از طریق آن به وسیله اسبهای تندرو تمامی اخبار، گزارشات و مکاتبات دولتی بین پایتخت با سایر ایالات انجام می‌شد.  این اسبها در جاده‌هایی موسوم به «راه شاهی» تردد می‌کردند و در فاصله هر 24 کیلومتر یک چاپارخانه قرار داشت که شخص چاپار پس از تعویض اسب خود با اسبی تازه‌نفس به راهش ادامه می‌داد. داریوش هخامنشی درباره پیک‌های دولتی خود می‌گوید: «نه برف، نه باران، نه گرما و نه تاریکی شب نمی‌تواند پیک‌های تندرو را از حرکت بازدارد.» این جمله امروز در بالای سردر ساختمان اداره پست نیویورک نقش بسته است</p><h3>پلتفرم آنلاین خدمات پستی آواکس </h3><p>پلتفرم آنلاین خدمات پستی آواکس با استفاده از تمامی ظرفیتهای پستی کشور با همکاری شرکتهای معتبر و با سابقه در زمینه حمل و نقل کالا با ایجاد بازارگاه پستی امکان سفارش گذاری ساده برای مشتری و امکان مقایسه و انتخاب راحت را برای مشتری ایجاد کرده است </p><p>پلتفرم آنلاین خدمات پستی آواکس با ایجاد تمرکز و مقایسه پذیری ساده برای مشتری ،حذف واسطه گری، صدور بارنامه الکترونیکی، توزیع هوشمند بار، صرفه جویی در وقت و هزینه کمتر، امکان رهگیری ساده را مقدور نموده است</p>', 'https://back.avaex.ir/common/611181686483361.jpg', 'null', 'null', 0, NULL, '2023-06-11 15:06:01'),
(3, 'پشتیبانی', NULL, 'https://back.avaex.ir/postupPics/aas.png', 'null', 'null', 0, NULL, '2022-12-12 12:28:46'),
(4, 'پست خارجی', '<p>سامانه آنلاین خدمات پستی آواکس با ارایه خدمات پست اکسپرس ضمن ارایه سرویسهای مطمئن، با قیمت ارزان و سریع در پست مرسوله ها به کلیه نقاط دنیا، ارسال مرسولات پستی ارزشمند شما (اعم از مدارک و نمونه کالاو بارهای تجاری و مسافری ) را تا مقصد مورد نظر برعهده گرفته و سلامت آن را تضمین می نماید. مرسولات شما در کمترین زمان و با بهترین قیمت ممکن از محل فرستنده دریافت و توسط سرویسهای پست بین الملل طرف قرارداد، با سامانه آنلاین پستی آواکس ؛ طبق قوانین بین الملل و استانداردهای لازم بسته بندی نموده و بالاترین امنیت در حمل ،مرسوله های پستی شما را ارسال می نماید.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>توجه: با عنایت به اینکه هر کشوری قوانین گمرکی خاص خود را دارد و همچنین ارسال و یا واردات کالا از مبدا و یا مقصد ایران شامل تعرفه ها و قوانین متفاوتی میباشد لذا برای پست خارجی در ابتدا ثبت سفارش کالا ، قیمت قطعی اعلام نمیشود فقط پس از ارسال عکس کالا و&nbsp;<strong> ارسال اسناد حمل برای مرسولات تجاری</strong> ،وبررسی موارد فوق همچنین پس از انتخاب شرکت حمل کننده توسط فرستنده ،قیمت نهائی در کمترین زمان ممکن توسط بخش پست خارجی سامانه آواکس به فرستنده اطلاع داده خواهد شد</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', 'https://back.avaex.ir/postupPics/aas.png', 'null', 'null', 0, NULL, '2023-05-13 10:23:05'),
(5, 'کیف پول', '<p>&nbsp;</p>\r\n\r\n<p><span dir=\"RTL\">کاربرگرامی&nbsp; : با استفاده از کیف پول پنل خود علاوه بر تخفیف 1.5در صد و عدم نیاز به رمز دوم از سرویس پسکرایه نیز میتوانید استفاده کنید&nbsp;</span></p>', 'https://back.avaex.ir/postupPics/wallet/iconWallet.png', 'null', 'null', 0, NULL, '2022-12-19 10:42:22'),
(6, 'پیک شهری', 'پیک درون شهری آواکس سرویس حمل و نقل درون شهری است که با کمک آن می‌توانید کالاهای فروشگاه آنلاین خود را به دست مشتریانتان برسانید. پیک درون شهری آواکس خدمات متفاوتی را ارائه می‌دهد که سرویس پیک موتوری آن، از محبوب‌ترین سرویس‌های ارسال کالا در کلان‌شهر تهران به شمار می‌رود. کسب و کارهای کوچک می‌توانند با سرویس پیک موتوری این شرکت، محصولات خود را به دست مشتریان خود برسانند. مزیت این سرویس، سرعت بسیار بالای آن به خاطر محدودیت‌های کمتر موتورسواران در ترافیک است. البته نگران نباشید. در صورتی که وزن و اندازه محموله قابل جابجایی با موتورسیکلت نباشد، پیک درون شهری آواکس خودروهای سواری پیک خود را به کار می‌گیرد...', 'https://back.avaex.ir/common/136181686481905.jpg', 'null', 'null', 0, NULL, '2023-06-11 14:41:45'),
(7, 'بسته بندی', '<h3>&nbsp;</h3>\r\n\r\n<p><span dir=\"RTL\">با گسترش کسب و کار های اینترنتی ،بازار خرید و فروش اینترنتی نیز به طرز چشم گیری افزایش پیدا کرده اس</span><span dir=\"RTL\">ت.</span> <span dir=\"RTL\">از آنجایی که خریداران و طرفداران خرید اینترنتی از نقاط مختلف جهان اقدام به خرید می نمایند ، بحث بسته بندی و ارسال این محصولات بیشتر به چشم میخورد.</span> <span dir=\"RTL\">نحوه ی صحیح بسته بندی کالا و ارسال آن از مهمترین موضوعاتی میباشد که فروشندگان کالا باید به آن توجه ویژه ای نمایند.</span> <span dir=\"RTL\">به بیان دیگر اگر کالای فروخته شده شما دارای بسته بندی اصولی و صحیحی نباشد از چند جهت شما متضرر خواهید شد.</span> <span dir=\"RTL\">شاید این سوال برایتان پیش بیاید که بسته بندی فاقد اصول استاندارد چه مضراتی برای ما میتواند داشته باشد ؟در جواب میگوییم که فروشگاه های معتبر دنیا اگر به این حد از پیشرفت و موفقیت دست پیدا کرده اند مهمترین فاکتور این پیشرفت اینست که تمامی اصول مورد نیاز برای کسب و کار خود را رعایت کرده اند ،همانطور که ذکر شد از اصلی ترین اصول در کسب و کار فروشگاه های اینترنتی بعد از تضمین اصل بودن کالا ، روش صحیح بسته بندی و ارسال اصولی مرسوله میباشد.</span> <span dir=\"RTL\">اگر مرسوله شما فاقد اصول بسته بندی استاندارد باشد، کالای ارسالیتان قطع یقین در طول مسیر ارسال دچار ضربه خواهد شد و این به اعتبار کاری شما لطمه زیادی وارد خواهد کرد. علاوه بر اینکه اعتبار کاری شما جریحه دار خواهد شد ، مشتری محترمی که فروشگاه شما را برای خرید انتخاب کرده است ، خواهان اعاده ی خسارت وارده خواهد بود، که این مورد هم از حقوق اولیه ی مشتری میباشد ، زیرا ارسال اصولی مرسوله بر عهده فروشنده بوده و فروشنده باید مرسوله را طوری بسته بندی نماید که سلامت </span></p>\r\n\r\n<p><span dir=\"RTL\">کالای فروخته شده حفظ گردد .</span></p>\r\n\r\n<p><span dir=\"RTL\">خاطر نشان میگردد نمایندگان رسمی ،سامانه آنلاین خدمات پستی آواکس در سراسر کشور آماده دریافت و بسته بندی مرسولات شما مطابق با استانداردهای بین المللی میباشند</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', 'https://back.avaex.ir/postupPics/box/box.png', 'null', 'null', 0, NULL, '2022-12-18 18:54:40'),
(8, 'اپلیکیشن', '<p>اپلیکیشن آواکس با بهره گیری از بهترین تکنولوژی به منظور تسهیل ارسال مرسولات شما در پلتفرم اندورید و اپل توسعه یافته است. در طراحی رابط کاربری اپلیکیشن آواکس سعی شده استاندارد های رابط کاربری لحاظ گردد تا عموم مردم به راحتی بتوانند مرسولات خود را ثبت و پیگیری نمایند.</p>\r\n\r\n<p>به واسطه اپلیکیشن آواکس می توانید مرسوله خود را با سرویس دهنده های مختلف پستی ارسال کنید و به صورت پیوسته از وضعیت مرسوله ی خود با خبر شوید. با اجرای اپلیکیشن آواکس در ابتدای کار با ورود اطلاعات خود وارد اکانت خود میشوید یا میتوانید در صورت نداشتن اکانت ثبت نام کنید. در صفحه ی خانه چندین ایتم کاربردی در دسترس به منظور رفع نیاز شما عزیزان قرار گرفته است. در قسمت منو کناری اپلیکیشن میتوانید میتوانید گزینه های شخصی وابسته به اکانت خود را از جمله پروفایل کاربری و آدرس هایی که در پلتفرم آنلاین پستی آواکس ثبت کرده اید و همچنین مرسولات خودرا بررسی کنید</p>', 'https://back.avaex.ir/common/400601686546311.jpg', 'null', 'null', 0, NULL, '2023-06-12 08:35:11'),
(9, 'درباره ی ما', '<p><span dir=\"RTL\"><strong>سامانه آواکس</strong> زیر مجموعه شرکت<strong> </strong><strong>پیشروترابرمهیارشرق</strong> &nbsp;با مشارکت گروهی از متخصصین باسابقه در صنعت حمل و نقل کشور و یک گروه نرم افزاری مجرب در مکانیزاسیون فرآیندها و سیستم های شرکت ها و موسسات حمل و نقل در سال 1400 تاسیس گردیده .هدف ما ارائه خدمات لجستیکی بر پایه فناوری اطلاعات و ارتباطات به مشتریان خود می باشد</span>.</p>\r\n\r\n<p><span dir=\"RTL\">رسالت خود را ارائه خدمات با کیفیت و قیمت مناسب در اسرع وقت و با پوشش بیمه ای مناسب به مشتریان خود می دانیم. ما رویکردی تکاملی برای بروز رسانی این صنعت مهم و استراتژیک در سطح کشور عزیزمان داریم.</span> <span dir=\"RTL\">از طریق <strong>وبسایت آواکس واپلیکیشن آواکس و پنل اختصاصی</strong> که در اختیار شما قرار داده میشود میتوانید قیمت و کیفیت ارسال بسته پستی تمام شرکت های پستی رو یک جا مقایسه کنید و با خیال راحت بسته خودتون رو ارسال و از تمامی مراحل بسته پستی تا مقصد مطلع شوید ضمنا اگر شما هم خدمات پست سریع درون شهری، بین شهری و بین الملل انجام میدید و میخوایید تو این رقابت بزرگ شرکت کنید و مشتریان جدید پیدا کنید این فرصت رو از دست ندهید</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span dir=\"RTL\">در زمینه پست خارجی ،مــا خدمــات و راهکارهای لجستیک بین الملل را بــرای افراد،کســب و کارهــا وســازمان های دولـتی بر مبنای زیرساخت انفورماتیک درسراسـر جهـان ارائـه می دهیـم. بـرای ما ، پیگیـری مرسـولات ومتعاقبـا تمام فرآیندهـای لجسـتیکی درکسـب وکار شما بسیار مهم است. مامتعهدهستیم کـه به طور مداوم عملکرد خود را ارتقـا و بهبود بخشیده وفرصت هایی را برای بازارهـای نوظهورتجـارت درخـارج ازکشور به شما عزیزان معرفـی کنیـم</span></p>', 'https://back.avaex.ir/common/506541686546778.jpg', 'null', 'null', 0, NULL, '2023-06-12 08:42:58'),
(10, 'اخذ نمایندگی', '<p>در پلتفرم آواکس سعی بر این بوده با نمایندگان متعددمان در سراسر کشور به پوشش حداکثری خدمات در سراسر کشور دست یابیم. به واسطه اخذ نمایندگی می توانید به درامدی مستمر وقابل توجه برسید و به خانواده بزرگ آواکس بپیوندید. با تکمیل فرم اخذ نمایندگی درخواست شما توسط همکاران ما بررسی میگردد و به زودی با شما تماس گرفته میشود.</p>\r\n\r\n<p>شما با اخذ نمایندگی آواکس در واقع بصورت غیر مستقیم (مجازی) نماینده چندین شرکت معتبر داخلی و خارجی&nbsp; از قبیل پست ملی ایران -ماهکس- چاپار و....خواهید بود و میتوانید از تمام مزایای&nbsp; نمایندگی انحصاری این شرکتها بهره ببرید&nbsp; ما این نمایندگیها را بطور یکجا در سامانه آواکس بصورت رایگان به شما اعطا میکنیم، در حالی که برای اخذ نمایندگی همه این شرکتها میبایست میلیاردها تومان هزینه کنید&nbsp;</p>\r\n\r\n<h3><em><strong>&nbsp;کسب درآمد سرشار ومستمر ،پاداش ماهیانه&nbsp; ،اقامت رایگان در مهمانسرای سامانه آواکس در شهرهای مشهد و بابلسر برای نمایندگان آواکس&nbsp; از مزایای اخذ نمایندگی سامانه&nbsp; آواکس میباشد</strong></em></h3>\r\n\r\n<p><strong>اگر تمایل به پیشرفت در جامعه پستی کشور عزیزمان را دارید جای شما در بین ما خالی هست</strong></p>\r\n\r\n<p>&nbsp;</p>', 'https://back.avaex.ir/postupPics/agent/agent.png', 'null', 'null', 0, NULL, '2023-05-21 14:21:51'),
(11, 'نشریه', NULL, 'https://back.avaex.ir/postupPics/wallet/iconWallet.png', 'null', 'null', 0, NULL, '2022-12-06 04:30:39'),
(12, 'فروشگاه آواکس', '<p><span dir=\"RTL\">فروشگاه اینترنتی آواکس ساخته شده است که در اختیار کسب کارهای مجازی از قبیل پیج های اینستا گرام، کانالهای تلگرام و بطور کلی کلیه فروشگاههایی که در بستر سوشیال مدیا فعالیت میکنند بطور رایگان قرارداده شود و این امکان را فراهم میکند که مشتریان شما بطور مستقیم خرید خود را از سایت فروشگاهی آواکس (ساب دامنه بنام فروشگاه شما )انجام داده &nbsp;و سرویس بهینه پستی مطابق با میل خود را از بین سرویس های متنوع سامانه آواکس انتخاب &nbsp;و در لحظه خرید فاکتور ، کد رهگیری ،بارنامه خود را از آواکس دریافت نمایند.</span></p>\r\n\r\n<p><span dir=\"RTL\">&nbsp;مزایای استفاده از فروشگاه آواکس :</span></p>\r\n\r\n<p><span dir=\"RTL\">مدیریت سفارشات - رهگیری آنلاین - انبارداری - سیستم حسابداری - &nbsp;فروش متمرکز -در اختیار داشتن پنل اختصاصی برای بارگذاشتن محصولات-جمع آوری و ارسال مرسولات فروشگاه شما بصورت سیستمی از مزایای فروشگاه آواکس میباشد .</span></p>', 'https://back.avaex.ir/common/276251687070618.jpg', 'null', 'null', 0, NULL, '2023-06-18 10:13:38'),
(13, 'سفارش انبوه', '<p><span dir=\"RTL\">ثبت سفارش انبوه ،گزینه ای بسیار </span><span dir=\"RTL\">منطقی و کاربردی در پلتفرم آنلاین آواکس ، برای آندسته از فروشگاههایی که روزانه تعداد بالایی سفارش با مقاصد مختلف&nbsp; دارند، میباشد . در این سرویس برای محصولاتی که دارای وزن و ابعاد و نوع کالاء مشابه هستند فقط یکبار مشخصات مرسوله را ثبت و سپس از دکمه کپی استفاده کرده و به هر تعداد که مایل باشید در کمترین زمان ممکن باتخصیص آدرس برای هر گیرنده سفارشات روزانه خود را ثبت میکنید .</span></p>\r\n\r\n<p><span dir=\"RTL\">همچنین برای تعداد مرسولات که ابعاد و وزن و آدرس گیرنده متفاوت دارند میتوان از دکمه افزودن در این سامانه استفاده نمود. با استفاده از سرویس سفارش انبوه آواکس بسیاری از هزینه ها کاهش یافته و قیمت برای مصرف کننده اقتصادی تر می شود. ارسال&zwnj;انبوه همچنین در سرعت ثبت و ارسال مرسوله بسیار اثر گذار خواهد بود. با استفاده از سرویس سفارش انبوه آواکس برای ثبت سفارشات با تعداد بالا چنانچه گیرنده یک شخص با یک آدرس واحد باشد فقط یک بارنامه با پارتهایی به تعداد مرسولات صادر شده در نتیجه کاهش هزینه بالایی را شاهد خواهید بود .</span></p>\r\n\r\n<p><span dir=\"RTL\">مضاف بر تمام موارد ذکر شده، پست و ارسال محصولات با تعداد بالا عملا بغیر از ارسال&zwnj;انبوه راه منطقی دیگری نخواهد داشت.</span></p>', 'https://back.avaex.ir/postupPics/bulk/bulk.png', 'null', 'null', 0, NULL, '2022-12-19 07:21:32'),
(14, 'پرداخت در محل', 'امروزه یکی از چالش‌های مهم در کسب‌وکارها، موضوع خرید و فروش آنلاین است و یکی از بسترهایی که خرید و فروش آنلاین می‌تواند در آنجا شکل بگیرد، فروشگاه‌های اینترنتی است. اغلب فروشگاه‌های اینترنتی در هنگام ثبت سفارش به مشتریان خود این امکان را می دهند که از سه طریق بتوانند هزینه کالای خود را پرداخت نمایند. این سه روش عبارتند از: 1. پرداخت آنلاین، 2. خدمات پرداخت در محل ، 3. پرداخت از طریق کیف پول؛ از میان این سه روش، روش پرداخت درب منزل هم گفته می‌شود،COD یکی از پرتقاضاترین روش‌ها است که به آن . اغلب افراد و فروشگاههای اینترنتی برای دست‌یابی به کالا و یا خدمات مورد نظرشان، مسیرهای مختلفی را پیش روی خود دارند. برای تهیه برخی کالاها و خدمات نیازمند حضور در مراکز خرید هستند، برخی را از طریق تلفن سفارش می‌دهند و کالاهای متنوعی را از طریق اپلیکیشن‌ها و وب‌سایت‌ها تهیه می‌کنند. با ظهور رسانه‌های اجتماعی، فروشگاه‌های آنلاین ایجاد شده در این رسانه‌ها نیز به جمع درگاه‌های خرید آنلاین اضافه شده و افراد زیادی خریدهای خود را از طریق این کانال‌ها انجام می‌دهند. اعتماد، موضوعی است که به‌ویژه در خریدهای آنلاین دارای اهمیت است. با وجود درگاه‌های مختلف برای پرداخت هزینه در فروشگاه‌های آنلاین، همچنان افرادی هستند که ترجیح می‌دهند هزینه سفارش خود را درب منزل و پس از تحویل گرفتن بار خود پرداخت کنند. پلتفرم آنلاین خدمات پستی آواکس ، به‌عنوان بخشی از این زنجیره تامین، می‌توانند نقش موثری در رشد و توسعه فروشگاه‌های آنلاین ایفا کرده و انتظارات مشتریان آنها را برطرف سازند. آواکس اکسپرس ، به‌عنوان اولین ارائه دهنده خدمات آنلاین پستی با سرویس درب‌به‌درب در کشور، به ارائه خدمات پرداخت در محل می‌پردازد. آواکس سعی دارد تا با ارائه این خدمت، علاوه بر کمک به توسعه خدمات فروشگاه‌های اینترنتی، نقش موثری در ایجاد اعتماد میان مشتریان و این فروشگاه‌ها ایفا کند. آواکس با دارا بودن نمایندگی های معتبر در تمام نقاط ایران، امکان ارسال بسته به سراسر کشور را فراهم می‌کند. به همین جهت، فروشگاه‌های آنلاین دغدغه‌ای بابت نرسیدن بسته به نقاط مختلف نداشته و به راحتی می‌توانند بسته‌های خود را به آواکس بسپارند.. در حال حاضر، تمامی نمایندگی‌های آواکس ارائه‌دهنده این خدمت بوده و فروشگاه‌های مختلف می‌توانند بر حسب میزان سفارش‌های خود، به‌صورت موردی و یا با عقد قرارداد، نسبت به استفاده از این خدمت اقدام کنند. به این ترتیب خریدار می‌تواند با خیال راحت، درب منزل هزینه سفارش خود را پرداخت کند. از طرف دیگر، فروشگاه‌های اینترنتی می‌توانند با آسودگی، محصولات خود را برای مشتریان ارسال کرده و هزینه آن را از طریق آواکس دریافت کنند. درواقع آواکس متعهد می‌شود تا هزینه بسته‌های ارسالی را درب منزل گیرنده دریافت کرده و آن را به فروشنده تحویل دهد. همچنین فرستنده می‌تواند هزینه ارسال را به‌صورت پسکرایه، نقدی یا نقدی-پسکرایه تعریف کند. در صورت تعریف پسکرایه هزینه، گیرنده علاوه بر پرداخت هزینه بسته خود، هزینه ارسال را نیز درب منزل پرداخت می‌کند. همچنین آواکس با ارائه خدمات بسته‌بندی در نمایندگی‌های خود، می‌تواند بسته‌بندی سفارشات را نیز انجام دهد. با توجه به متفاوت بودن کالاها، آواکس با ارائه شیوه‌های مختلف و بسته‌بندی‌های مطمئن، سعی دارد تا ضمن حفظ امنیت بسته‌ها، به بهترین شکل ممکن بسته‌ها را به گیرنده برساند. علاوه بر این، برای حفظ حقوق مشتریان، خدمت جبران خسارت برای بسته‌های ارسالی توسط آواکس درنظر گرفته شده تا در صورت بروز خسارت احتمالی، امکان جبران خسارت و جلب رضایت مشتریان وجود داشته باشد. آواکس آماده عقد قرارداد با تمامی اشخاص حقیقی و حقوقی در زمینه ارائه خدمات پرداخت در محل بوده و افراد متقاضی می‌توانند از طریق تماس با شماره 09053169105 و یا مراجعه به نمایندگی‌های آواکس در سراسر کشور، نسبت به استفاده از این سرویس اقدام کنند', 'https://back.avaex.ir/common/311951686480409.jpg', 'null', 'null', 0, NULL, '2023-06-11 14:16:49'),
(15, 'سرویس درب تا درب', '<p>&nbsp;</p>\r\n\r\n<p><span dir=\"RTL\">افراد در سراسر جهان برای ارسال و جابه جا کردن کالاهای خود از پست استفاده می کنند. یکی از جدیدترین و بهترین راه های ارسال کالاها استفاده از پست درب تا درباست، امروزه این خدمت بسیار مورد توجه افراد قرار گرفته است</span>.</p>\r\n\r\n<p><span dir=\"RTL\">در این روش دیگر نیازی نیست برای ارسال کالا به پست مراجعه شود، با استفاده از روش درب تا دربفرستنده، کالا را از درب منزل به مامور پستی تحویل می دهد و تحویل گیرنده نیز در درب منزل خود کالا را دریافت می کند. جلب اعتماد مشتری یکی از نکاتی است که&nbsp; تمام شرکت های حمل و نقل بار&nbsp; باید به آن توجه کنند؛ شرکت دانا حمل با ارائه مطمئن و ایمن خدمات پست درب تا درب ارسال کالا را برای مشتریان خود بسیار سریع و راحت کرده است.</span>.</p>\r\n\r\n<p>&nbsp;<span dir=\"RTL\">محبوب ترین سرویس پستی که در تمام دنیا از آن استفاده می شود، سرویس درب تا درب است. ارسال&nbsp; درب تادرب معمولاً توسط اتوبارها، شرکت های حمل و نقل، باربری ها در خارج&nbsp; و داخل شهرها انجام می شود. بهره گیری از این سرویس باعث کاهش هزینه برای فرستنده می شود؛ در روش&zwnj;های دیگر پستی واسطه های بسیاری بین فرستنده و گیرنده وجود دارد، اما در این روش افراد تنها کافی است محلی را برای ارسال بسته تعیین کنند، پستچی بسته&nbsp; را در آن مکان دریافت کرده و به گیرنده تحویل می دهد. هیچ واسطه ای به جز مامور پست در این بین حضور ندارد؛ خدمات حمل درب تا دربباعث کاهش مصرف سوخت، کاهش آلودگی هوا، حفاظت از محیط زیست، کاهش خطاهای انسانی، راحتی در رهگیری&nbsp; مرسوله ، کاهش هزینه های عملیاتی و &hellip; می شود</span></p>', 'https://back.avaex.ir/common/635781686479520.jpg', 'null', 'null', 0, NULL, '2023-06-11 14:02:00'),
(16, 'پست اکسپرس', '<p>&nbsp;</p>\r\n\r\n<p>پست اکسپرس انتقال مرسولات پستی را در زمان کم و با بیمه کامل و محافظت ویژه انجام می دهد.</p>\r\n\r\n<p>به گزارش ایسنا، بنابر اعلام پست بار، در واقع این نوع از پست در قبال بسته پستی مسئولیت بیشتری دارد و با دریافت هزینه بسته ها را با توجه به نوع آنها تحت شرایط ویژه جابجا می کند.</p>\r\n\r\n<p><strong>پست اکسپرس چیست؟</strong></p>\r\n\r\n<p>پست اکسپرس&nbsp;در واقع نوعی از خدمات پست است ک دارای مزایا و شرایط ویژه ای است. این نوع از راه های نقل و انتقال مرسولات پستی به دلیل داشتن آپشن ها و ویژگی هایی که دارد توانسته توجه بسیاری از افراد را به خود جلب کند.</p>\r\n\r\n<p>&nbsp;پست اکسپرس&nbsp;همچنین در سطح بین المللی نیز به شدت مورد توجه قرار گرفته و افراد برای ارسال بسته های خود به خارج از کشور از این نوع پست استفاده می کنند. اما این نوع از روش انتقال بسته های بسته دقیقا چیست و چه مزایایی دارد ؟&nbsp;<a href=\"https://mag.postbar.ir/index.php/2020/11/30/post-express/\"><strong>پست اکسپرس</strong></a>&nbsp;انتقال مرسولات پستی را در زمان کم و با بیمه کامل و محافظت ویژه انجام می دهد.</p>\r\n\r\n<p>در واقع این نوع از پست در قبال بسته پستی مسئولیت بیشتری دارد و با دریافت هزینه بسته ها را با توجه به نوع آنها تحت شرایط ویژه جابجا می کند. همچنین یکی دیگر از نکات مهمی که در مورد&nbsp;پست اکسپرس&nbsp;باید به آن توجه کرد زمان ارسال و رسیدن بسته به مقصد است.</p>\r\n\r\n<p>در پست های عادی و حتی پیشتاز، مدت زمان دریافت محصولات بین ۳ تا ۵ روز کاری است (در پست های داخل). اما در این نوع پست با پرداخت هزینه زمان رسیدن بسته حداقل ۲۴ ساعت می باشد.</p>\r\n\r\n<p><strong><em>سامانه آنللاین خدمات پستی پستاپ با سرویسهای ویژه مرسولات شما را در 24 ساعت به مقصد میرساند</em></strong>&nbsp;</p>', 'https://back.avaex.ir/postupPics/express/express.png', 'null', 'null', 0, NULL, '2022-12-19 18:00:24'),
(17, 'سفارش تلفنی', '<p><strong>ثبت سفارش تلفنی</strong>&nbsp;</p>\r\n\r\n<p>&nbsp;مرسولات ثبت شده از طریق تلفن دقیقا همانند ثبت اینترنتی جمع آوری و ارسال میگرددچنانچه به هر دلیلی از جمله عدم آشنایی با اینترنت یا عدم دسترسی به اینترنت یا اپلیکیشن و سایت آواکس&nbsp; کاربری نتواند سفارش خود را ثبت نماید ،میتواند از طریق تماس تلفنی با پشتیبانی سامانه آواکس سفارش خود را ثبت نماید</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>09053169105 :تلفن ثبت سفارش&nbsp;</strong></h3>\r\n\r\n<p>&nbsp;</p>', 'https://back.avaex.ir/common/527421686481760.jpg', 'null', 'null', 0, NULL, '2023-06-11 14:39:20'),
(18, 'سفارش آنلاین', '<p><span dir=\"RTL\">با ثبت سفارش مرسولات خود بصورت آنلاین در محل کار یا زندگی خود و پرداخت آنلاین هزینه پستی ضمن صرفه جویی در وقت و هزینه ارسال ،همکاران ما در اسرع وقت نسبت به جمع آوری سفارش شما از درب منزل یا محل کار شمااقدام مینمایند همچنین در هنگام ثبت سفارش &nbsp;در لحظه فاکتور و کد رهگیری دریافت مینمائید .</span></p>', 'https://back.avaex.ir/common/485351686545850.jpg', 'null', 'null', 0, NULL, '2023-06-12 08:27:30'),
(19, 'پس کرایه', '<p>&nbsp;</p>\r\n\r\n<p><span dir=\"RTL\">پس&zwnj;کرایه، تراکنش مالی محسوب می&zwnj;شود که در آن هزینه کالا در زمان تحویل از گیرنده دریافت می&zwnj;شود</span>.</p>\r\n\r\n<p><span dir=\"RTL\">سرویس پس کرایه همانطور که از نامش مشخص است به سرویسی گفته می&zwnj;شود که مشتری پس از ارائه خدمات پستی، هزینه حمل و نقل را پرداخت می&zwnj;کند. این سرویس مزایای بسیاری داشته و بسیار مورد توجه صاحبین بار قرار گرفته است</span></p>\r\n\r\n<p><span dir=\"RTL\">حمل بار به صورت پس کرایه به این معناست که هزینه پست و حمل و نقل در زمان تحویل بسته پرداخت می&zwnj;شود. به طور واضح&zwnj;تر می&zwnj;توان گفت فرستنده هنگام ارسال بسته هزینه&zwnj;ای پرداخت نکرده ولی متعهد می&zwnj;شود که پس از تحویل بسته به گیرنده، هزینه پستی پرداخت شود. بنابراین نیازی به پرداخت کرایه حمل قبل از بارگیری نمی&zwnj;باشد</span></p>', 'https://back.avaex.ir/common/217621686480434.jpg', 'null', 'null', 0, NULL, '2023-06-11 14:17:14'),
(20, 'پیش کرایه', '<p><strong>پیش کرایه</strong>&nbsp;به معنای پرداخت هزینه بسته&zwnj; ارسالی توسط فرستنده بسته می باشد. به طور واضح تر می توان اینطور بیان کرد که گیرنده بسته&zwnj; ارسالی هیچ&zwnj;گونه هزینه ای پرداخت نمی کند&nbsp;</p>\r\n\r\n<p>تحویل مرسوله در کمترین زمان ممکن و سریع ترین روش در سرتاسر کشور و پرداخت هزینه حمل توسط گیرنده از مهم ترین شاخص های برجسته این نوع سیستم پیش کرایه می باشد.</p>', 'https://back.avaex.ir/common/870401686481655.jpg', 'null', 'null', 0, NULL, '2023-06-11 14:37:35'),
(21, 'مرسولات من', '<p>با پیشرفت و مدرن شدن جوامع، خدماتی جدیدی برای حمل بسته های افراد در سریع ترین زمان ممکن به وجود آمده است. پست کردن یک مرسوله کاری است که امروزه بسیار رواج دارد؛ اما هنوز هم برای پست مرسولات با ارزش و گران قیمت نگرانی وجود دارد.&nbsp;شاید تا به حال برای شما هم پیش آمده که برای ارسال یک بسته وقت کافی ندارید و نگران هستید که هر چه زودتر بسته ارسالیتان به دست طرف مقابلتان برسد؛ اما از کجا باید متوجه شویم که بسته پستی ارسال شده ما، در چه وضعیتی قرار دارد؟ آیا از شهر خودمان خارج یا وارد شهر مقصد شده است؟&nbsp;<strong>پیگیری مرسوله پستی</strong>&nbsp;خدمتی از <strong>سامانه آنلاین آواکس</strong> است که به راحتی می توانید به وسیله آن از وضعیت مرسولات ارسالی خود مطلع شوید و&nbsp;<strong>پیگیری مرسولات پستی با کد ملی</strong>&nbsp;یا&nbsp;<strong>کد رهگیری</strong>&nbsp;را انجام دهید.&nbsp;</p>\r\n\r\n<p>دقت داشته باشید که سامانه&nbsp;<strong>رصد مرسولات پستی</strong>&nbsp;به شما این امکان را می دهد که به سادگی و در چند ثانیه، تک تک اقدامات صورت گرفته بر روی مرسوله پستی تان را ببینید و از مراحل رسیدن مرسوله پستی خود آگاه شوید.</p>\r\n\r\n<p>&nbsp;</p>', 'https://back.avaex.ir/postupPics/wallet/iconWallet.png', 'null', 'null', 0, NULL, '2023-04-19 08:24:21'),
(22, 'نمایندگان ما', NULL, 'https://back.avaex.ir/postupPics/wallet/iconWallet.png', 'null', 'null', 0, NULL, '2022-12-06 04:57:32'),
(23, 'راهنما', '<p>&nbsp;</p>\r\n\r\n<p><span dir=\"RTL\">از اینکه سامانه آنلاین خدمات پستی آواکس را جهت ارسال مرسولات خود انتخاب کرده اید متشکریم .چنانچه هنگام استفاده از سامانه با مشکلاتی ، از قبیل : ثبت سفارش داخلی ،ثبت سفارش خارجی ، ثبت سفارش انبوه ،همچنین طریقه واگزاری نمایندگی سامانه&nbsp; آواکس ،واگزاری رایگان پنل فروشگاهی آواکس به پیج های اینستگرامی و ..... نیاز به راهنمایی دارید با استفاده از دکمه درخواست راهنما ،و ثبت مشخصات و درج مشکل خود همکارراهنمای سامانه آواکس در کمترین زمان ممکن پاسخ گوی شما خواهند بود . سپاس از اعتماد شما </span></p>', 'https://back.avaex.ir/common/940041687164086.jpg', 'null', 'null', 0, NULL, '2023-06-19 12:11:26'),
(24, 'قوانین سامانه پستآپ', '<p>&nbsp;</p>\r\n\r\n<p><strong><span dir=\"RTL\">قوانین و مقررات</span></strong></p>\r\n\r\n<p><strong><span dir=\"RTL\">کاربر گرامی؛</span></strong></p>\r\n\r\n<p><span dir=\"RTL\">به منظور استفاده از خدمات وب&zwnj;سایت سامانه آنلاین خدمات پستی آواکس ضروری است که از قوانین و مقررات وب&zwnj;سایت آگاه بوده و این سند را به دقت مطالعه کنید</span>.</p>\r\n\r\n<p><span dir=\"RTL\">ورود شما به وب&zwnj;سایت سامانه آنلاین خدمات پستی آواکس با حساب کاربری شخصی و ثبت سفارش، به منزله آگاهی از قوانین و مقررات سامانه آنلاین خدمات پستی آواکس و پذیرفتن کامل آنهاست</span>.</p>\r\n\r\n<p><span dir=\"RTL\">از آنجا که فعالیت&zwnj;های سامانه آنلاین خدمات پستی آواکس منطبق با قوانین جمهوری اسلامی ایران، قانون تجارت الکترونیک و قانون حمایت از حقوق مصرف کننده است، کاربران وبسایت نیز موظف به رعایت قوانین مربوطه هستند. لازم به ذکر است استمرار در استفاده از خدمات سامانه آنلاین خدمات پستی آواکس به معنای توافق در این مورد و تغییراتی احتمالی است که به&zwnj;صورت پیوسته در این صفحه به&zwnj;روزرسانی خواهد شد</span></p>\r\n\r\n<p><strong><span dir=\"RTL\">تعریف کاربر</span>:</strong></p>\r\n\r\n<p><span dir=\"RTL\">کاربر به شخصی گفته می&zwnj;شود که اطلاعات کاربری خود را در فرم ثبت&zwnj;نام سامانه آنلاین خدمات پستی آواکس درج کرده باشد و با این اطلاعات، از خدمات سامانه آنلاین خدمات پستی آواکس شامل ثبت سفارش یا هرگونه خدمات دیگراستفاده کند</span>.</p>\r\n\r\n<p><span dir=\"RTL\">این تعریف با توجه به این&zwnj;که سامانه آنلاین خدمات پستی آواکس یک&nbsp; پلتفرم آنلاین تابع قانون تجارت الکترونیک است، برای کلیه قوانین وب&zwnj;سایت معتبر است</span></p>\r\n\r\n<p><span dir=\"RTL\">ارتباطات الکترونیکی و حریم خصوصی</span></p>\r\n\r\n<p>- <span dir=\"RTL\">تعامل شما با سامانه آنلاین خدمات پستی آواکس برای ارائه خدمات، مکاتبات و پاسخ&zwnj;گویی&zwnj;ها از طریق ارتباطات الکترونیکی صورت می&zwnj;پذیرد و به این ترتیب با استفاده از خدمات وب&zwnj;سایت، شما به&zwnj;صورت ضمنی توافق کرده&zwnj;اید که سامانه آنلاین خدمات پستی آواکس به درخواست&zwnj;های شما از طریق ارتباطات الکترونیکی پاسخگو باشد</span></p>\r\n\r\n<p>- <span dir=\"RTL\">برای ارتباط با مشتریان، بهینه&zwnj;سازی محتوای وب&zwnj;سایت و تحقیقات بازاریابی، سامانه آنلاین خدمات پستی آواکس ممکن است از اطلاعات شما استفاده کند و برای اطلاع&zwnj;رسانی رویدادها و اخبار، خدمات و سرویس&zwnj;های ویژه یا تخفیف&zwnj;ها، برای اعضای وب&zwnj;سایت ایمیل یا پیامک ارسال کند. این حق برای شما وجود دارد که در صورت عدم تمایل به دریافت این ایمیل&zwnj;ها و پیامک&zwnj;ها، عضویت دریافت خبرنامه سامانه آنلاین خدمات پستی آواکس را در پروفایل خود لغو کنید. لغو نکردن عضویت، به منزله موافقت ضمنی با دریافت ایمیل&zwnj;ها و پیام&zwnj;ها و سلب حق اعتراض تلقی می&zwnj;شود</span></p>\r\n\r\n<p>ایمیل های&nbsp; سامانه آواکس و شرکت پیشروترابرمهیار شرق به آدرس: <a href=\"mailto:info@avaex.ir\">info@avaex.ir</a>&nbsp; <a href=\"mailto:وpishrotarabar@yahoo.com%20میباشد\">و<span dir=\"LTR\">pishrotarabar@yahoo.com</span> میباشد</a> &nbsp;ودر صورت نیاز به ارتباط با سامانه با تلفن 09053169105تماس حاصل نماییدهمچنین میتوانید از قسمت پشتیبانی تیکت ارسال نمایید.</p>\r\n\r\n<p><span dir=\"RTL\">هرگونه شماره یا آدرس ایمیل دیگری، سوءاستفاده از نام آواکس بوده و شما می&zwnj;توانید در این زمینه سامانه آنلاین خدمات پستی آواکس را از طریق ایمیل </span></p>\r\n\r\n<p>support@avaex.ir</p>\r\n\r\n<p><span dir=\"RTL\">&nbsp;یا تلفن 09053169105مطلع ساخته تا برای پیگیری قانونی اقدام شود </span></p>\r\n\r\n<p><span dir=\"RTL\">متذکر میشویم :تنها مرجع رسمی&nbsp; سامانه آواکس به آدرس :www.avaex.ir میباشد&nbsp;</span></p>\r\n\r\n<p><span dir=\"RTL\">هویت شخصی کاربران نزد سامانه آنلاین خدمات پستی آواکس محرمانه است و اطلاعات شخصی کاربران از طریق سامانه آنلاین خدمات پستی آواکس به هیچ شخص یا سازمان دیگری منتقل نمی&zwnj;شود. مورد استثنا تنها هنگامی است که سامانه آنلاین خدمات پستی آواکس با حکم مقام قضایی یا اداری صالحه یا طبق قوانین و مقررات رایج کشور، موظف باشد اطلاعاتی را در اختیار مراجع ذی&zwnj;صلاح قرار دهد. در این موارد هیچ گونه مسئولیت قانونی مبنی بر جبران خسارت برای سامانه آنلاین خدمات پستی آواکس وجود ندارد و کاربر به&zwnj;صورت ضمنی با اعلام رضایت در استفاده از خدمات وب&zwnj;سایت، حق هرگونه اعتراض را از خود سلب کرده&zwnj; است</span>.</p>\r\n\r\n<p>- <span dir=\"RTL\">نگهداری از رمز عبور و نام کاربری برای ورود به سامانه آنلاین خدمات پستی آواکس برعهده کاربران و لازم است برای جلوگیری از سوءاستفاده&zwnj;های احتمالی آن را تنها نزد خود نگه داشته و برای دیگران افشا نکنند</span>.</p>\r\n\r\n<p>- <span dir=\"RTL\">در صورتی که کاربر شماره تلفن همراه خود را به شخص دیگری واگذار کند، این وظیفه برای او متصور می&zwnj;شود که برای جلوگیری از سوءاستفاده یا مشکلات احتمالی، شماره موبایل خود را در پروفایل تغییر داده و شماره جدید را ثبت کند. مسئولیت هرگونه خسارت احتمالی که ناشی از عدم رعایت موارد اشاره&zwnj;شده باشد، با شخص کاربر بوده و در این زمینه با قبول مقررات وب&zwnj;سایت، حق هرگونه ادعا علیه سامانه آنلاین خدمات پستی آواکس را از خود سلب کرده&zwnj; است</span>.</p>\r\n\r\n<p>- <span dir=\"RTL\">همه محتواهای منتشرشده در وب&zwnj;سایت سامانه آنلاین خدمات پستی آواکس مانند متن، گرافیک، لوگو، آیکون دکمه، تصاویر، ویدئوها و کلیه محتوای تولیدشده توسط سامانه آنلاین خدمات پستی آواکس جزو اموال سامانه آنلاین خدمات پستی آواکس محسوب می&rlm;&zwnj;شود و حق استفاده و نشر تمامی مطالب موجود و در دسترس در انحصار سامانه آنلاین خدمات پستی آواکس است. هرگونه استفاده بدون کسب مجوز کتبی، حق پیگرد قانونی را برای سامانه آنلاین خدمات پستی آواکس محفوظ می&rlm;&zwnj;دارد</span>.</p>\r\n\r\n<p>- <span dir=\"RTL\">کاربران مجاز به بهره&zwnj;&rlm;برداری و استفاده از مشخصات فنی، قیمت و هرگونه استفاده از مشتقات وب&rlm;&zwnj;سایت سامانه آنلاین خدمات پستی آواکس یا هر یک از خدمات و مطالب، دانلود یا کپی کردن اطلاعات با مقاصد تجاری، هرگونه استفاده از داده&zwnj;کاوی یا روش&zwnj;&rlm;های مشابه مانند جمع&zwnj;آوری داده&zwnj;&rlm;ها و ابزارهای استخراج نیستند و کلیه این حقوق برای سامانه آنلاین خدمات پستی آواکس محفوظ است</span>.&nbsp;</p>\r\n\r\n<p><strong><span dir=\"RTL\">ارائه خدمات</span></strong></p>\r\n\r\n<p>- <span dir=\"RTL\">وقتی سفارشی در سامانه آنلاین خدمات پستی آواکس نهایی می&zwnj;شود، با ارسال کد سفارش از طریق پیام کوتاه به مشتری اطلاع&zwnj;رسانی می&zwnj;شود و به این ترتیب سفارش در صف پردازش قرار می&rlm;&zwnj;گیرد. در غیراین&zwnj;صورت ثبت سفارش صورت نگرفته است. بدیهی است که سامانه آنلاین خدمات پستی آواکس هیچ&zwnj; مسئولیتی نسبت به سفارشاتی که رها می&zwnj;شوند، ندارد</span>.</p>\r\n\r\n<p>- <span dir=\"RTL\">سامانه آنلاین خدمات پستی آواکس نهایت تلاش خود را برای ارسال به&zwnj;موقع سفارش&zwnj;ها در زمان&zwnj;بندی توافق&zwnj;شده به کار می&zwnj;گیرد اما در روزهایی که به علت تخفیف&zwnj;ها و پروموشن&zwnj;ها، میزان سفارش&zwnj;گذاری از حد معمول بیشتر می&zwnj;شود، یا به دلایل دیگر این امکان وجود دارد که بازه&zwnj;های تحویل سفارش طولانی&zwnj;تر شوند یا سفارش&zwnj;ها با تاخیر به دست مشتری برسند. در چنین شرایطی حتما از طریق پیامک به شما اطلاع&zwnj;رسانی خواهد شد</span>.</p>\r\n\r\n<p>- <span dir=\"RTL\">سامانه آنلاین خدمات پستی آواکس مجاز است بدون اطلاع قبلی به مشتریان، سفارش&zwnj;&rlm;گیری جدید وخدمات خود را متوقف کند. اما کلیه سفارش&zwnj;&rlm;های ثبت&zwnj;شده قبل از توقف سفارش&zwnj;&rlm;گیری، باید پردازش و ارسال شوند</span>.</p>\r\n\r\n<p>- <span dir=\"RTL\">تحویل سفارش در اماکن عمومی همچون کافه، رستوران، هتل و سایر مکان&zwnj;های عمومی امکان&zwnj;پذیر نیست و آدرس تحویل به مشتری باید دقیق و قابل&zwnj;استناد باشد</span></p>\r\n\r\n<p>-<span dir=\"RTL\">کدهای تخفیف&zwnj; سامانه آنلاین خدمات پستی آواکس، برای یک بار استفاده توسط هر کاربر حقیقی یا حقوقی تعریف شده&zwnj;اند. چنانچه اثبات شود یک کاربر به هر طریقی از جمله استفاده از چند حساب کاربری یا خط تلفن همراه، برای استفاده چندباره از کدهای تخفیف اقدام کرده، این حق برای سامانه آنلاین خدمات پستی آواکس وجود دارد که اعلام خسارت کرده و گاربر بایستی جبران خسارت نماید &nbsp;</span>..</p>\r\n\r\n<p><strong><span dir=\"RTL\">محتوا</span></strong></p>\r\n\r\n<p>- <span dir=\"RTL\">سامانه آنلاین خدمات پستی آواکس هیچ گونه مسئولیتی درباره حذف شدن صفحه&rlm;&zwnj;های سایت خود یا لینک&rlm;&zwnj;های مرده نمی&zwnj;&rlm;پذیرد</span>.</p>\r\n\r\n<p>- <span dir=\"RTL\">نظراتی که کاربران در خصوص سفارشات در سامانه آنلاین خدمات پستی آواکس درج می&zwnj;کنند، حاصل تجربه یا اطلاعات شخصی افراد است و برای ایشان یا سامانه آنلاین خدمات پستی آواکس مسئولیتی ایجاد نمی&zwnj;کند. بدیهی است سامانه آنلاین خدمات پستی آواکس مسئولیتی در قبال درستی این اطلاعات ندارد</span>.</p>\r\n\r\n<p>- <span dir=\"RTL\">سامانه آنلاین خدمات پستی آواکس همچنین مسئولیتی در قبال اطلاعات درج&zwnj;شده روی بسته&zwnj;بندی سفارشات ندارد و مسئولیت آن با فرستنده میباشد </span>&nbsp;ر</p>\r\n\r\n<p>&nbsp;<strong><span dir=\"RTL\">قوانین اجرایی سامانه آواکس :</span></strong></p>\r\n\r\n<p><span dir=\"RTL\">&nbsp;ارسال کننده (کاربر)بایستی در هنگام ثبت سفارش وزن و محتوای بسته را بدرستی&nbsp; به دقت و صداقت اعلام نماید چنانچه وزن اعلام شده مغایر با وزن واقعی باشد ، سفارش کنسل خواهد شد و مسئولیت تاخیر در ارسال، هزینه سفارش مجدد و یا هرگونه خسارت ناشی از این امر به عهده ارسال کننده&nbsp; خواهد بود</span></p>\r\n\r\n<p><span dir=\"RTL\">&nbsp;کاربر میبایست آدرس گیرنده را&nbsp; درهنگام ثبت به درستی درج نماید تا موجب برگشتی سفارش و یا هزینه های مجدد نگردد</span></p>\r\n\r\n<p><span dir=\"RTL\">کاربر بایستی آدرس فرستنده اعم از استان، شهر و منطقه را صحیح انتخاب نماید و چنانچه این امر به درستی صورت نگیرد مسئولیت ناشی از تاخیر در جمع آوری و یا کنسلی سفارش به عهده کاربر خواهد بود</span></p>\r\n\r\n<p><span dir=\"RTL\">کاربر بایستی از شنبه تا پنجشنبه، جهت تحویل مرسوله به جمع آور تا ساعت 19 در محل اظهار شده ثبت سفارش (آدرس فرستنده) حضور داشته باشد و در صورت عدم حضور، این امر به منزله لغو سفارش است و هیچ مبلغی از بابت سفارش لغو شده&nbsp; مسترد نخواهد شد و همچنین &nbsp;هیچ گونه ادعایی در این خصوص نخواهد داشت. همچنین در شرایط آب و هوایی بارانی یا برفی و یا مناطق گرمسیر (درجه حرارت بالای ۴۵ درجه) و مناطق سرد سیر (درجه حرارت زیر صفر درجه) این امکان وجود دارد که فرایند جمع آوری با تاخیر انجام پذیرد.</span>.</p>\r\n\r\n<p><span dir=\"RTL\">کلیه سفارشات ثبت شده در روزجمعه و ایام تعطیل در اولین روز کاری بعد از ثبت سفارش&nbsp; جمع آوری خواهد شد وکاربر در این خصوص هیچ اعتراضی نخواهد داشت، </span></p>\r\n\r\n<p><span dir=\"RTL\">کاربر میبایست هر &nbsp;گونه شکایت در خصوص خسارت وارده به هر مرسوله ای&nbsp; را صرفا ظرف 24ساعت پس از سفارش از و عدم پذیرش آن مرسوله اعلام دارد و در غیر این صورت هیچ گونه اعتراضی نخواهد داشت&nbsp; ضمنا تعهد بیمه مرسوله تا لحظه تحویل آن به گیرنده اعتبار خواهد داشت</span>.</p>\r\n\r\n<p><span dir=\"RTL\">کاربر بایستی&nbsp; که کالای فاسد شدنی ، ممنوعات پستی و قاچاق، وزن بیش از 30کیلو، مایعات و ابعاد بیش&nbsp; از 1 متر&nbsp; در مرسوله پستی قرار ندهد و مندرجات بند ممنوعات پستی رارعایت نماید</span></p>\r\n\r\n<p>&nbsp;<span dir=\"RTL\">و همچنین کالای شکستنی&nbsp; ارسال ننماید مگر آنکه کلیه ضوابط بسته بندی را رعایت نموده باشد، که در صورت عدم رعایت ضابطه فوق و بروز خسارت، هیچ اعتراضی نخواهد داشت و مسئولیت محتوای کلیه کالاهای مندرج در بسته به عهدهشخص کاربر می باشد، همچنین شرکت هیچ گونه مسئولیتی در قبال اطلاع رسانی بسته بندی مرسوله ندارد و در صورت ارسال مرسوله با هرنوع بسته بندی تبعات آن به عهده فرستنده می باشد</span>.</p>\r\n\r\n<p><span dir=\"RTL\">کاربر بایستی </span><span dir=\"RTL\">سفارش خود را که حاوی کد رهگیری می باشد&nbsp; را پرینت و بر روی&nbsp; بسته الصاق نماید وحتما آنرا امضا کند و سپس&nbsp; نسخه دیگر را به امضای جمع آور برساند و به عنوان رسید نزد خود نگهدارد.. ضمنا کلیه قوانین پستی را در خصوص محتوای بسته پستی رعایت نماید و اگر خلاف این امر را انجام دهد کلیه مسئولیت های ناشی از خسارت و غیره به عهده اینجانب می باشد و اگر چنانچه به پرینتر دسترسی نداشته باشد، آدرس فرستنده، گیرنده و شماره سفارش را بر روی بسته بندی مرسوله با ماژیک درج بنماید</span></p>\r\n\r\n<p><span dir=\"RTL\">کاربر نمیتواند کلمه کاربری و رمز عبورخود رادر اختیار فرد دیگری قرار دهد که در غیر این صورت کلیه مسئولیت ها و تعهدات مندرج در بند های این تعهدنامه&nbsp; به عهده کاربر میباشد </span></p>\r\n\r\n<p><span dir=\"RTL\">کاربر قبول میکند </span><span dir=\"RTL\">&nbsp;کلیه موارد لازم در مورد بسته بندی صحیح و عدل بندی را با هزینه خود انجام دهد تا بسته در زمان حمل پاره نشود و چنانچه مرسوله به بسته بندی مجدد نیاز داشت هزینه آن را طبق نظرکارشناس بپردازد یا مبلغ بسته بندی از</span> <span dir=\"RTL\">حساب کیف پول کاربر&nbsp; اتوماتیک کسر گردد</span></p>\r\n\r\n<p><span dir=\"RTL\">خاطر نشان میگردد که سفارش هایی که تا قبل از ساعت 12&nbsp;&nbsp; همان روز در سامانه آواکس ثبت گردد ، جهت جمع آوری ارجاع&nbsp; و تا ساعت 18 از محل ثبت شده برای فرستنده جمع آوری میگردد</span></p>\r\n\r\n<p><span dir=\"RTL\">کاربر میپذیرد در صورت عدم جمع آوری مرسوله ثبت شده در سامانه ظرف 24 ساعت تاخیر در جمع آوری را به اطلاع شرکت برسانم در غیر این صورت حق هرگونه اعتراض نسبت به جمع آوری کالا را از خود سلب نموده است </span></p>\r\n\r\n<p><span dir=\"RTL\">جمع آوری بارها، از درب منزل یا محل کار انجام می شود و و مرسوله بایستی باید&nbsp; ، در محل درب ورودی ساختمان تحویل داده شود و در صورت نیاز به رویت محتویات مرسوله امکان بازدید آن فراهم گردد.</span></p>\r\n\r\n<p><span dir=\"RTL\">همچنین چنانچه از درج&nbsp; امضا در بخش امضای مشتری&nbsp; در فاکتوردریافتی از سامانه &nbsp;خودداری نماید &nbsp;حق هرگونه اعتراضی را نسبت به دریافت غرامت ناشی از خسارت یا فقدان مرسوله را از خود سلب می نماید. &nbsp;</span></p>\r\n\r\n<p><span dir=\"RTL\">کاربرنمیتواند از بارکد نامعتبر استفاده نماید در صورتی که از یک بارکد نامعتبر(کنسل شده) یا بارکدی که قبلا مرسوله آن ارسال شده استفاده کند. شامل جریمه نقدی تا 5 برار هزینه بارکد استفاده شده خواهد شد</span></p>\r\n\r\n<p><span dir=\"RTL\">مرسوله جمع آوری شده تحت هیچ شراطی عودت داده نخواهد شد مگر اینکه مشکل قانونی داشته باشد</span></p>\r\n\r\n<p><strong><span dir=\"RTL\">کنسلی سفارش</span></strong></p>\r\n\r\n<p><span dir=\"RTL\">در صورت ثبت سفارش از طریق سامانه آواکس، چنانچه درخواست کنسلی سفارش را داشته باشد هیچ مبلغی عودت داده نخواهد شد</span></p>\r\n\r\n<p><span dir=\"RTL\">وچنانچه در زمان تحویل مرسولات، بسته ای تحویل داده نشود، به منزله کنسل شدن مرسوله می باشد&nbsp;</span></p>\r\n\r\n<p><span dir=\"RTL\">در زمان ثبت سفارش و استفاده از سرویس پسکرایه یا پرداخت در محل </span></p>\r\n\r\n<p><span dir=\"RTL\">مبلغ 1،500،000 ريال داخل کیف پول بلوکه خواهد شد. درصورت&nbsp; درخواست کنسل کردن سفارش&nbsp; &nbsp;پس کرایه، چنانچه تعداد سفارش های پس کرایه ثبت شده زیر10 سفارش باشد مبلغ عودت و در صورت ثبت سفارش بالای 10 تا، مبلغ عودت نخواهد شد و از مبلغ بلوکه شده می توان به جای هزینه سفارش پیش کرایه استفاده کرد</span><span dir=\"RTL\"> و چنانچه مبلغ بلوکه شده کفاف هزینه را ندهد کاربر میبایست هزینه فوق را پرداخت نماید </span></p>\r\n\r\n<p><span dir=\"RTL\">کاربر،چنانچه درخواست بازگشت کیف پول را داشته باشد این امر با ارسال تیکت و درخواست بازگشت کیف پول امکان پذیر میباشد ۷۲ ساعت پس از ارسال تیکت و اعلام شماره شبا مبلغ باقیمانده کیف پول عودت داده خواهد شد</span> &nbsp;</p>\r\n\r\n<p><strong><span dir=\"RTL\">تعهدات بیمه ای</span></strong></p>\r\n\r\n<p><span dir=\"RTL\">کلیه مرسولات تا درب محل گیرنده دارای بیمه می باشد و پس از تحویل به گیرنده و دریافت امضای گیرنده، هیچ گونه غرامتی پرداخت نخواهد شد&nbsp; لذا گیرنده بایستی از دریافت مرسوله آسیب دیده خودداری نماید</span></p>\r\n\r\n<p><span dir=\"RTL\">شرکت تنها در صورتی غرامت خسارت مرسوله را پرداخت می نماید که خود، کالا را بسته بندی نموده باشد. همچنین بیمه انتخاب شده متضامن کالاهایی که دارای بسته بندی استاندارد نمی باشند، نخواهد بود</span>.</p>\r\n\r\n<p><span dir=\"RTL\">مشتریانی که بیش از ۲ بار در ۱۰۰ مرسوله درخواست خسارت نمایند هیچگونه خسارتی حتی با رعایت شروط فوق پرداخت نخواهد شد</span></p>\r\n\r\n<p><span dir=\"RTL\">در صورت دست دوم بودن کالا، قیمت کالای نو مشابه پس از برآورد&nbsp; معادل 50% قیمت کالای نو تا سقف بیمه درخواست شده پرداخت میشود</span></p>\r\n\r\n<p><span dir=\"RTL\">در زمان درخواست غرامت برای مرسولات ثبت شده با سرویس ، می بایستی&nbsp; مشخصات کارت ملی متقاضی غرامت (تصویر کارت ملی)، آدرس و شماره حساب در بخش مشخصات متقاضی غرامت در&nbsp; درسایت &nbsp;درج گردد</span></p>\r\n\r\n<p><strong><span dir=\"RTL\">ممنوعات پستی</span></strong></p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp; <span dir=\"RTL\">ممنوعات پستی به شرح ذیل میباشند: مایعات ، مرسولات شکستنی، تجهیزات ماهواره، فیلترشکن ها، دارو ، مشروبات الکی و مواد مخدر، تجهیزات نظامی، لوازم جنسی، مواد محترقه، اسکریپت های غیرمجاز، لوازم قمار، تجهیزات مخابراتی غیرمجاز، تجهیزات جاسوسی، اقلام مستهجن ، فالگیری و رمالی، پول نقد، چک، سفته ، اوراق بهادار&nbsp; و جواهرات، فرش، مدارک شناسایی، اسناد</span></p>\r\n\r\n<p><span dir=\"RTL\">و همچنین در ارسال به سایر کشورها هم پس از دریافت مرسوله توسط فعال پستی به شما اعلام خواهد شد که مرسوله جزء&nbsp; ممنوعات پستی به کشور مقصد مورد نظرشما هست یا خیر</span></p>', 'https://back.avaex.ir/common/423571687165134.jpg', 'null', 'null', 0, NULL, '2023-06-19 12:28:54'),
